            "instructions": "<ol><li>Place cod in a bowl and cover with cold water. Soak for 6 to 8 hours, changing the water once or twice. Drain, rinse very well and pat dry. Shred fish with your fingers.</li><li>Pour 3 inches of water into a medium saucepan and bring to a boil. Add the diced potatoes, and cook until tender, 10 to 12 minutes. Drain the potatoes, return them to the pan briefly. (The heat from the pan will evaporate excess moisture from the potatoes.) Mash the potatoes until smooth, then whisk in the butter.</li><li>Stir the cod into the mashed potatoes. Stir in the green onion, cilantro, olives, egg white, sesame oil, salt, garlic, ginger and pepper.</li><li>In a chilled bowl, whip the cream until it holds soft peaks. Gently fold the whipped cream into cod mixture with a rubber spatula.</li><li>Using two large soupspoons, form about 3 tablespoons of the cod-potato mixture into an oval fish cake. Set the cod cake on a baking sheet and repeat with the remaining potato mixture.</li><li>Spread the breadcrumbs on a plate. Beat the egg in a wide, shallow bowl. Dip each cod cake into egg, turning it gently to coat all sides. Allow any excess egg to drip back into the bowl, then roll the cake in breadcrumbs to coat all sides. Set the coated fish cakes on a baking sheet.</li><li>Place a large skillet over medium heat and pour in 1/4 inch of vegetable oil. When the oil is hot - a corner of a cod cake will give off a lively sizzle when dipped in the oil - add as many of the fish cakes to the skillet as will fit without touching each other. (You may need to do this in two batches.) Cook, turning once, until golden brown, about 5 to 7 minutes.</li><li>Remove the fish cakes with a slotted spoon and drain them on paper towels. If necessary, repeat with the remaining cod cakes. Serve warm.</li><li>This recipe yields 4 servings.</li></ol>",
