            "summary": "If you want to add more <b>gluten free and dairy free</b> recipes to your recipe box, Toasted Tropical Marshmallows might be a recipe you should try. This recipe serves 6. For <b>$1.06 per serving</b>, this recipe <b>covers 4%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains around <b>4g of protein</b>, <b>10g of fat</b>, and a total of <b>493 calories</b>. If you have coconut, water, confectioners' sugar, and a few other ingredients on hand, you can make it. A couple people made this recipe, and 22 would say it hit the spot. It is brought to you by Foodista. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 11%</b>. This score is rather bad. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/toasted-coconut-marshmallows-558910\">Toasted Coconut Marshmallows</a>, <a href=\"https://spoonacular.com/recipes/caramelized-yams-with-toasted-marshmallows-517833\">Caramelized Yams with Toasted Marshmallows</a>, and <a href=\"https://spoonacular.com/recipes/pumpkin-sheet-cake-with-toasted-marshmallows-945747\">Pumpkin Sheet Cake With Toasted Marshmallows</a>.",
