            "summary": "You can never have too many dessert recipes, so give OREO Cookie Balls  Snowman a try. This recipe serves 12 and costs $1.75 per serving. One portion of this dish contains approximately <b>5g of protein</b>, <b>27g of fat</b>, and a total of <b>465 calories</b>. From preparation to the plate, this recipe takes about <b>1 hour and 15 minutes</b>. This recipe is liked by 1416 foodies and cooks. If you have oreo cookies, gel icing, bakers chocolate, and a few other ingredients on hand, you can make it. It is brought to you by Pink When. Taking all factors into account, this recipe <b>earns a spoonacular score of 0%</b>, which is improvable. Similar recipes include <a href=\"https://spoonacular.com/recipes/reindeer-and-snowman-oreo-cookie-balls-+-oreo-stuffed-cookies-622109\">Reindeer and Snowman Oreo Cookie Balls + Oreo Stuffed Cookies</a>, <a href=\"https://spoonacular.com/recipes/snowman-oreo-cookie-balls-489438\">Snowman OREO Cookie Balls</a>, and <a href=\"https://spoonacular.com/recipes/snowman-oreo-cookie-balls-516559\">Snowman Oreo Cookie Balls</a>.",
