            "summary": "Tomato Cutlets might be just the main course you are searching for. One serving contains <b>384 calories</b>, <b>19g of protein</b>, and <b>17g of fat</b>. For <b>$3.14 per serving</b>, this recipe <b>covers 30%</b> of your daily requirements of vitamins and minerals. 19 people were impressed by this recipe. Head to the store and pick up baby eggplant, eggs, bread crumbs, and a few other things to make it today. To use up the eggs you could follow this main course with the <a href=\"https://spoonacular.com/recipes/rose-levy-beranbaums-chocolate-tomato-cake-with-mystery-ganache-27408\">Rose Levy Beranbaum's Chocolate Tomato Cake with Mystery Ganache</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 88%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/chicken-cutlets-with-tomato-saut-27288\">Chicken Cutlets with Tomato Saut</a>, <a href=\"https://spoonacular.com/recipes/turkey-cutlets-with-tomato-sauce-411770\">Turkey Cutlets with Tomato Sauce</a>, and <a href=\"https://spoonacular.com/recipes/pork-cutlets-parmesan-with-tomato-sauce-146196\">Pork Cutlets Parmesan with Tomato Sauce</a> for similar recipes.",
