            "instructions": "<ol><li>Prepare the eggs, bread crumbs and sliced tomatoes.</li><li>Dip the tomato slice in the egg wash and then in the bread crumbs.  If you have extra egg wash and bread crumbs you can repeat this process.</li><li>Heat a large frying pan with the olive oil and place the prepared tomato slices in the pan.  When the tomatoes have a nice golden color gently flip and finish cooking on the other side.  This will take about 3-4 minutes on each side on medium heat.</li><li>Place halved eggplant in the frying pan and sprinkle with dashes of salt and pepper.  Let the eggplant saut on one side to a golden color then turn and saut on the other side.  This will take about 3  4 minutes on each side.</li><li>Plate and finish with the parsley garnish, lemon juice and grated cheese.</li></ol>",
