            "summary": "Brooklyn Blackout Cake might be just the dessert you are searching for. This recipe serves 10 and costs 61 cents per serving. One serving contains <b>329 calories</b>, <b>8g of protein</b>, and <b>16g of fat</b>. 6 people have tried and liked this recipe. A mixture of baking powder, cornstarch, vanillan extract, and a handful of other ingredients are all it takes to make this recipe so tasty. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 38%</b>. This score is not so spectacular. Try <a href=\"https://spoonacular.com/recipes/the-new-brooklyn-blackout-cake-597262\">The New Brooklyn Blackout Cake</a>, <a href=\"https://spoonacular.com/recipes/brooklyn-blackout-cake-recipe-157830\">Brooklyn Blackout Cake Recipe</a>, and <a href=\"https://spoonacular.com/recipes/brooklyn-blackout-cakelets-553680\">Brooklyn Blackout Cakelets</a> for similar recipes.",
