            "summary": "The recipe Hummus and Za'atar is ready <b>in around 45 minutes</b> and is definitely an outstanding <b>gluten free and vegan</b> option for lovers of middl eastern food. For <b>$1.61 per serving</b>, you get a marinade that serves 4. One serving contains <b>778 calories</b>, <b>34g of protein</b>, and <b>31g of fat</b>. This recipe from foodandspice.blogspot.com has 35 fans. If you have sea salt, garlic, juice of lemon, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 99%</b>. This score is excellent. Similar recipes include <a href=\"https://spoonacular.com/recipes/chopped-hummus-dip-with-zaatar-180958\">Chopped Hummus Dip with Za'atar</a>, <a href=\"https://spoonacular.com/recipes/hummus-deviled-eggs-with-zaatar-exercise-challenge-626237\">Hummus Deviled Eggs with Zaatar {Exercise Challenge}</a>, and <a href=\"https://spoonacular.com/recipes/zaatar-bread-rolls-manaiesh-bi-zaatar-132855\">Za'atar Bread Rolls (Manaiesh Bi Za'atar)</a>.",
