            "instructions": "<p>Apple Roasted Pork Loin</p><p>Apples and pork is a pretty traditional combination and I couldn't count the number of ways I've put the two together in the past but this one is a little different. The Granny Smith apples are diced quite small and then cooked in a reduction of honey, apple cider vinegar and spices. Granny Smiths are good to use because they won't break down into apple sauce during the cooking. The cooked apples are then used as a top crust and glaze for the roast pork. Some garlic roast potatoes and steamed veggies completed a wonderful family meal. Here's your Sunday supper!</p><p>Lb pork loin or rib roast</p><p>Season the pork with salt and pepper and open roast on a rack in a roasting pan at 375 degrees F for about a half hour.</p><p>Meanwhile dice very small, (about a 1/4 inch dice)</p><p>Large Granny Smith apples, peeled and cored</p><p>In a large saute pan over medium heat add:</p><p>Tbsp olive oil</p><p>Cloves minced garlic</p><p>Cook for a minute or two to soften but not brown the garlic. Add:</p><p>Cup honey</p><p>Cup apple cider vinegar</p><p>Tsp pepper</p><p>Tsp sea salt</p><p>Teaspoon Chinese five spice powder</p><p>Tsp freshly grated nutmeg</p><p>Bring the mixture to a boil and simmer until the volume is reduced by about half. Increase the heat to mediun-high. Add the diced apple and cook, stirring occasionally until most of the liquid has reduced off.</p><p>After half an hour in the oven, take the roast out and spoon the apples all over the top. Return the roast to the oven, reduce the heat to 350 degrees F and cook uncovered until the internal temperature reaches 170 degrees F on a meat thermomether inserted into the center of the roast. Allow the pork to rest for about 15 minutes before carving and serving.</p>",
