            "imageType": "jpg",
            "summary": "The recipe Minestrone Soup could satisfy your Mediterranean craving in around <b>45 minutes</b>. This main course has <b>351 calories</b>, <b>20g of protein</b>, and <b>16g of fat</b> per serving. This recipe serves 8 and costs $1.98 per serving. A couple people made this recipe, and 14 would say it hit the spot. If you have into strips, celery, carrots, and a few other ingredients on hand, you can make it. To use up the celery you could follow this main course with the <a href=\"https://spoonacular.com/recipes/pistachio-shortbread-cookies-557632\">Pistachio Shortbread Cookies</a> as a dessert. <b>Autumn</b> will be even more special with this recipe. All things considered, we decided this recipe <b>deserves a spoonacular score of 70%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/minestrone-soup-31875\">Minestrone Soup</a>, <a href=\"https://spoonacular.com/recipes/minestrone-soup-183910\">Minestrone Soup</a>, and <a href=\"https://spoonacular.com/recipes/minestrone-soup-629604\">Minestrone Soup</a> for similar recipes.",
