                            "step": "Remove the brownies from the fridge and pour the melted chocolate over the brownies, gently and quickly spread the chocolate evenly over the brownies. The mint filling should be cold so the warm chocolate doesnt melt the mint filling, but the chocolate will cool quickly once it touches the cold mint. Make sure to work quickly so the chocolate layer will be even. Return the brownies to the fridge to cool for another 5 minutes until the chocolate is set.",
