            "summary": "Forget going out to eat or ordering takeout every time you crave Indian food. Try making Creamy Curry Chicken With Yellow Rice at home. One serving contains <b>348 calories</b>, <b>4g of protein</b>, and <b>30g of fat</b>. This gluten free, dairy free, lacto ovo vegetarian, and vegan recipe serves 3 and costs <b>$1.3 per serving</b>. 13 people have tried and liked this recipe. Head to the store and pick up ground ginger, lemon juice, onion, and a few other things to make it today. It is brought to you by Foodista. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 47%</b>, which is solid. Similar recipes are <a href=\"https://spoonacular.com/recipes/yellow-curry-chicken-with-basmati-rice-516045\">Yellow Curry Chicken with Basmati Rice</a>, <a href=\"https://spoonacular.com/recipes/one-pan-thai-coconut-yellow-curry-chicken-rice-+-video-943333\">One Pan Thai Coconut Yellow Curry Chicken & Rice + Video</a>, and <a href=\"https://spoonacular.com/recipes/yellow-thai-curry-coconut-fried-rice-578200\">Yellow Thai Curry Coconut Fried Rice</a>.",
