            "summary": "Gluten Free Almond Blueberry Coffee Cake requires approximately <b>1 hour</b> from start to finish. One portion of this dish contains approximately <b>6g of protein</b>, <b>11g of fat</b>, and a total of <b>298 calories</b>. For <b>67 cents per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. This recipe serves 8. This recipe is liked by 40 foodies and cooks. A mixture of almonds, vanilla yogurt, blueberries, and a handful of other ingredients are all it takes to make this recipe so delicious. It works well as a very budget friendly morn meal. It is a good option if you're following a <b>gluten free and lacto ovo vegetarian</b> diet. It is brought to you by Pink When. Overall, this recipe earns a <b>not so outstanding spoonacular score of 27%</b>. Try <a href=\"https://spoonacular.com/recipes/gluten-free-blueberry-coffee-cake-541568\">Gluten-free Blueberry Coffee Cake</a>, <a href=\"https://spoonacular.com/recipes/blueberry-coffee-cake-gluten-free-768694\">Blueberry Coffee Cake  Gluten Free</a>, and <a href=\"https://spoonacular.com/recipes/gluten-free-almond-berry-coffee-cake-160312\">Gluten-Free Almond Berry Coffee Cake</a> for similar recipes.",
