            "imageType": "jpg",
            "summary": "Barbecue Chicken Cauliflower Couscous Bowls might be just the main course you are searching for. This recipe makes 4 servings with <b>440 calories</b>, <b>23g of protein</b>, and <b>25g of fat</b> each. For <b>$2.4 per serving</b>, this recipe <b>covers 32%</b> of your daily requirements of vitamins and minerals. If you have olive oil, chicken breasts, cauliflower, and a few other ingredients on hand, you can make it. To use up the sea-salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/raspberry-sea-salt-brownies-494161\">Raspberry Sea Salt Brownies</a> as a dessert. It will be a hit at your <b>Father's Day</b> event. This recipe from Pink When has 398 fans. It is a good option if you're following a <b>gluten free</b> diet. This recipe is typical of American cuisine. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 95%</b>. This score is excellent. Try <a href=\"https://spoonacular.com/recipes/couscous-bowls-with-zaatar-chickpeas-and-roasted-cauliflower-612788\">Couscous Bowls with Zaatar Chickpeas and Roasted Cauliflower</a>, <a href=\"https://spoonacular.com/recipes/barbecue-chicken-and-veggie-rice-bowls-for-lunchboxes-534542\">Barbecue Chicken and Veggie Rice Bowls for Lunchboxes</a>, and <a href=\"https://spoonacular.com/recipes/shredded-chicken-cauliflower-rice-burrito-bowls-609374\">Shredded Chicken Cauliflower Rice Burrito Bowls</a> for similar recipes.",
