            "image": "https://spoonacular.com/recipeImages/637516-556x370.jpg",
            "imageType": "jpg",
            "summary": "You can never have too many main course recipes, so give Cheddar Polenta With Bacon Wrapped Asparagus a try. Watching your figure? This gluten free recipe has <b>470 calories</b>, <b>19g of protein</b>, and <b>28g of fat</b> per serving. This recipe serves 1 and costs $2.4 per serving. 19 people were impressed by this recipe. A mixture of spears of asparagus, coarse corn grits, extra sharp cheddar cheese, and a handful of other ingredients are all it takes to make this recipe so flavorful. To use up the pepper you could follow this main course with the <a href=\"https://spoonacular.com/recipes/dr-pepper-cake-with-flour-cooked-frosting-539165\">Dr. Pepper Cake with Flour Cooked Frosting</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 56%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/bacon-wrapped-eggs-with-polenta-78094\">Bacon-wrapped Eggs With Polenta</a>, <a href=\"https://spoonacular.com/recipes/bacon-wrapped-eggs-with-polenta-78481\">Bacon-Wrapped Eggs with Polenta</a>, and <a href=\"https://spoonacular.com/recipes/berghoffs-bacon-wrapped-shrimp-over-blue-moon-roasted-red-pepper-polenta-562595\">Berghoffs Bacon-Wrapped Shrimp Over Blue Moon-Roasted Red Pepper Polenta</a> for similar recipes.",
