            "instructions": "<ol><li>Preheat the oven to 400. Wrap 6 thick asparagus spears with two slices of raw bacon.</li><li>Place on a small baking sheet and spritz the bundle with nonstick cooking spray, just to coat the asparagus lightly. Sprinkle with salt and pepper.</li><li>Roast for 15-20 minutes, or until the bacon is crispy and the asparagus is tender.</li><li>Make the cheddar polenta while the asparagus is roasting: Bring chicken broth to a boil in a small saucepan.</li><li>Stir in polenta.Lower the heat and cook slowly for 5 minutes, stirring occasionally until the mixture has thickened.</li><li>Stir in the cheese. I used extra sharp cheddar, but any kind would work. Add a dash of salt and pepper, or more to taste.</li><li>Scoop the polenta in a dish and top with the bacon wrapped asparagus.</li></ol>",
