            "summary": "Chocolate Wafers might be just the dessert you are searching for. This recipe makes 40 servings with <b>30 calories</b>, <b>1g of protein</b>, and <b>1g of fat</b> each. For <b>5 cents per serving</b>, this recipe <b>covers 1%</b> of your daily requirements of vitamins and minerals. A few people made this recipe, and 10 would say it hit the spot. A mixture of ap flour, margarine, cocoa powder, and a handful of other ingredients are all it takes to make this recipe so delicious. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 8%</b>. This score is very bad (but still fixable). Try <a href=\"https://spoonacular.com/recipes/vanilla-chocolate-wafers-142042\">Vanilla Chocolate Wafers</a>, <a href=\"https://spoonacular.com/recipes/chocolate-mint-wafers-401020\">Chocolate Mint Wafers</a>, and <a href=\"https://spoonacular.com/recipes/chocolate-mint-wafers-517136\">Chocolate- Mint Wafers</a> for similar recipes.",
