            "instructions": "<ol><li>Combine the flour, cocoa, baking soda, and salt in a small bowl and mix together thoroughly with a whisk or fork. Set aside.</li><li>Beat the butter and margarine with an electric mixer for a few seconds just until blended.</li><li>Add the granulated sugar, brown sugar, and vanilla and beat at high speed for about 1 minute.</li><li>Beat in the egg white.</li><li>Add the flour mixture and mix on low speed, just until incorporated.</li><li>Gather the dough together with your hands and form it into a 9- to 10-inch log.</li><li>Wrap the log in wax paper or foil. Fold or twist the ends of the paper without pinching or flattening the log</li><li>Refrigerate for at least 45 minutes, or until needed.</li><li>Preheat the oven to 350F. Position racks in the upper and lower thirds of the oven.</li><li>Use a sharp knife to cut the dough log into slices a scant 1/4\" thick.</li><li>Place 1 inch apart on cookie sheets and bake for 12 - 14 minutes, or until the cookies puff and crackle on top, then begin to settle down slightly.</li><li>Rotate baking sheets from top to bottom and front to back about halfway through the baking time to ensure even baking.</li><li>Slide the parchment or foil onto cooling racks and cool the cookies completely before storing or stacking.</li></ol>",
