            "summary": "Sex in a glass might be just the side dish you are searching for. For <b>83 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. This recipe makes 6 servings with <b>566 calories</b>, <b>3g of protein</b>, and <b>32g of fat</b> each. A few people made this recipe, and 79 would say it hit the spot. If you have instant espresso, cream, sugar, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. It is a good option if you're following a <b>gluten free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 21%</b>. This score is not so great. Similar recipes include <a href=\"https://spoonacular.com/recipes/stained-glass-jello-also-known-as-broken-glass-jello-507424\">Stained Glass Jello (also known as Broken Glass Jello)</a>, <a href=\"https://spoonacular.com/recipes/apple-pie-in-a-glass-70498\">Apple Pie In A Glass</a>, and <a href=\"https://spoonacular.com/recipes/sea-glass-jello-517579\">Sea Glass Jello</a>.",
