            "summary": "Skinny Veggie Fried Rice takes around <b>around 45 minutes</b> from beginning to end. This side dish has <b>175 calories</b>, <b>5g of protein</b>, and <b>9g of fat</b> per serving. This recipe serves 2. For <b>$1.4 per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. A mixture of , salt, baby corns, and a handful of other ingredients are all it takes to make this recipe so tasty. It is brought to you by Foodista. Only a few people really liked this Chinese dish. This recipe is liked by 8 foodies and cooks. It is a good option if you're following a <b>gluten free, dairy free, lacto ovo vegetarian, and vegan</b> diet. Overall, this recipe earns a <b>great spoonacular score of 92%</b>. Try <a href=\"https://spoonacular.com/recipes/skinny-chicken-fried-rice-484957\">Skinny Chicken Fried Rice</a>, <a href=\"https://spoonacular.com/recipes/skinny-garlic-fried-rice-601655\">Skinny Garlic Fried Rice</a>, and <a href=\"https://spoonacular.com/recipes/veggie-fried-rice-846125\">Veggie Fried Rice</a> for similar recipes.",
