            "summary": "Shrimp pasta with white wine tomato cream sauce is a <b>pescatarian</b> main course. For <b>$3.45 per serving</b>, this recipe <b>covers 22%</b> of your daily requirements of vitamins and minerals. One serving contains <b>530 calories</b>, <b>33g of protein</b>, and <b>9g of fat</b>. A couple people made this recipe, and 10 would say it hit the spot. If you have 5 oz. shrimp, olive oil, garlic, and a few other ingredients on hand, you can make it. To use up the heavy cream you could follow this main course with the <a href=\"https://spoonacular.com/recipes/homemade-blizzards-with-reeses-peanut-butter-eggs-549987\">Homemade Blizzards with Reeses Peanut Butter Eggs</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 72%</b>. This score is good. Similar recipes include <a href=\"https://spoonacular.com/recipes/white-wine-pasta-with-tomato-sauce-795405\">White Wine Pasta with Tomato Sauce</a>, <a href=\"https://spoonacular.com/recipes/shrimp-linguine-in-a-tomato-and-white-wine-sauce-247797\">Shrimp Linguine in a Tomato and White Wine Sauce</a>, and <a href=\"https://spoonacular.com/recipes/pasta-with-sausage-mushrooms-and-white-wine-cream-sauce-590820\">Pasta with Sausage, Mushrooms and White Wine Cream Sauce</a>.",
