            "summary": "The recipe Vanilla Coconut Snowball Cupcakes can be made <b>in about around 45 minutes</b>. For <b>52 cents per serving</b>, you get a dessert that serves 13. Watching your figure? This lacto ovo vegetarian recipe has <b>412 calories</b>, <b>4g of protein</b>, and <b>21g of fat</b> per serving. 9 people found this recipe to be scrumptious and satisfying. This recipe is typical of American cuisine. It is brought to you by Foodista. Head to the store and pick up regular milk, , salt, and a few other things to make it today. All things considered, we decided this recipe <b>deserves a spoonacular score of 12%</b>. This score is not so tremendous. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/coconut-snowball-cupcakes-598417\">Coconut Snowball Cupcakes</a>, <a href=\"https://spoonacular.com/recipes/hersheys-coconut-creme-kisses-chocolate-cupcakes-with-vanilla-coconut-frosting-492912\">Hersheys Coconut Creme Kisses & Chocolate Cupcakes with Vanilla Coconut Frosting</a>, and <a href=\"https://spoonacular.com/recipes/vanilla-bean-coconut-cupcakes-with-coconut-frosting-190375\">Vanilla Bean-Coconut Cupcakes with Coconut Frosting</a>.",
