            "summary": "The recipe Mardi Gras Shrimp touffe can be made <b>in roughly 1 hour and 30 minutes</b>. For <b>$5.35 per serving</b>, this recipe <b>covers 34%</b> of your daily requirements of vitamins and minerals. This recipe makes 4 servings with <b>443 calories</b>, <b>40g of protein</b>, and <b>21g of fat</b> each. Not a lot of people made this recipe, and 1 would say it hit the spot. It works well as an expensive main course. It is brought to you by Foodista. If you have butter, garlic cloves, tomato, and a few other ingredients on hand, you can make it. Overall, this recipe earns a <b>tremendous spoonacular score of 87%</b>. <a href=\"https://spoonacular.com/recipes/magnolia-bar-and-grill-crawfish-etouffee-it-doesnt-have-to-be-mardi-gras-to-enjoy-a-cajun-599541\">Magnolia Bar and Grill Crawfish Etouffee  it doesnt have to be Mardi Gras to enjoy a Cajun</a>, <a href=\"https://spoonacular.com/recipes/mardi-gras-cupcakes-650965\">Mardi Gras Cupcakes</a>, and <a href=\"https://spoonacular.com/recipes/mardi-gras-slaw-198387\">Mardi Gras Slaw</a> are very similar to this recipe.",
