            "summary": "Authentic Biscochitos takes approximately <b>about 45 minutes</b> from beginning to end. One portion of this dish contains around <b>11g of protein</b>, <b>2g of fat</b>, and a total of <b>691 calories</b>. This dairy free and lacto ovo vegetarian recipe serves 4 and costs <b>$1.01 per serving</b>. It is brought to you by Foodista. 11 person have made this recipe and would make it again. Head to the store and pick up baking powder, sugar, egg, and a few other things to make it today. Taking all factors into account, this recipe <b>earns a spoonacular score of 43%</b>, which is pretty good. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/biscochitos-204969\">Biscochitos</a>, <a href=\"https://spoonacular.com/recipes/mi-tierra-biscochitos-155548\">Mi Tierra Biscochitos</a>, and <a href=\"https://spoonacular.com/recipes/rendered-fat-biscochitos-200593\">Rendered Fat Biscochitos</a>.",
