            "instructions": "<ol><li>To Make Cake:</li><li>Sift together dry ingredients. Add oil, coffee and milk. Whisk until combined. Add eggs and vanilla. Whisk until well incorperated (about 2 min.). It will be quite runny.</li><li>Grease and flour 2- 9 inch round pans. Pour the batter into the pans and bake at 325F for 25-30 min until a toothpick inserted into the centre comes out clean.</li><li>Let the cakes cool in the pans for 10 min. before removing to cool completely.</li><li>To Make Strawberry Mousse:</li><li>Mix together the cream cheese and sugar until completely smooth. Mix in the pureed strawberries.</li><li>Whip the cream to stiff peaks and fold into the strawberry cream cheese mixture.</li><li>Line a 9 inch round pan (the same size you used for the cakes) with plastic wrap and pour the mousse inside. Freeze until solid.</li><li>To Make Ganache:</li><li>Bring cream to a boil over medium heat.</li><li>Poor over chocolate. Let sit for a moment then stir until smooth.</li><li>Let cool to room temp.</li><li>To Assemble:</li><li>Remove mousse from freezer and unwrap.</li><li>Place one cake layer on serving platter. Position frozen mousse in the centre and top with remaining cake layer.</li><li>Allow to thaw for 30 min, or so.</li><li>Meanwhile drizzle with ganache and garnish with fresh strawberries.</li></ol>",
